import { BrowserRouter as Router,Routes,Route } from "react-router-dom"
import OTP1 from "./OTP1"
import OTP3 from "./OTP3"
function OTPROUTRS(){
    return(
        <div>
            <Router>
                <Routes>
                    <Route path="/" element={<OTP1/>}/>
                    <Route path="/OTP3" element={<OTP3/>}/>
                </Routes>
            </Router>


        </div>
    )
}
export default OTPROUTRS;
